"""Le liste supportano anche funzioni e metodi: len() per contare gli elementi, min() e max() per trovare l'elemento pi piccolo/grande (a patto che i tipi degli elementi siano comparabili), .index() per trovare l'indice di un elemento, e .count() per contare quante volte un elemento  presente nella lista:"""

